<!DOCTYPE html>
<html lang="en">
<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>Rollercoaster Animation</title>
    <style>
        body {
            display: flex;
            justify-content: center;
            align-items: center;
            height: 100vh;
            background-color: #222;
        }
        .container {
            position: relative;
            width: 200px;
            height: 200px;
        }
        .center-image {
            position: absolute;
            width: 300px;
            height: 300px;
            background: url("priyanka.png") no-repeat center/cover;
            top: 50%;
            left: 50%;
            transform: translate(-50%, -50%);
        }
        .icon {
            position: absolute;
            top: 50%;
            left: 50%;
            width: 50px;
            height: 50px;
            transform-origin: center;
            animation: orbit 5s linear infinite;
        }
        .icon img {
            width: 70%;
            height: 70%;
        }
        
        @keyframes orbit {
            0% { transform: rotate(0deg) translateX(200px) rotate(0deg); }
            100% { transform: rotate(360deg) translateX(200px) rotate(-360deg); }
        }
    </style>
</head>
